import React, { useState } from 'react'

const closing = () => {
  // alert("I am Clicked");
  document.getElementById("tForm").style.display = "none";
  document.getElementById("tSearch").style.display = "block";
}


const Student = () => {
  const submit = async (e) => {
    e.preventDefault();
    // alert("Hi " + Name + Surname + Edu + Stream + Comm + Add + Adno + Ref + Mob)

    const formData = {
      Name,
      Surname,
      Edu,
      Stream,
      Comm,
      Add,
      Adno,
      Ref,
      Mob
    };

    try {
      const response = await fetch("http://localhost:5000/login", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify(formData)
      });
      console.log(response);
      alert("Form submitted successfully!");
    }
    catch (err) {
      console.log(err)
      alert("Error submitting form");
    }

  }

  const [Name, setName] = useState("");
  const [Surname, setSurname] = useState("");
  const [Edu, setEdu] = useState("");
  const [Stream, setStream] = useState("");
  const [Comm, setComm] = useState("");
  const [Add, setAdd] = useState("");
  const [Adno, setAdno] = useState("");
  const [Ref, setRef] = useState("");
  const [Mob, setMob] = useState("");

  return (
    <>
      <div className="container-fluid min-vh-100 d-flex align-items-center justify-content-center bg-light">
  <div className="card shadow-lg p-4" style={{ maxWidth: "700px", width: "100%" }}>
    
    <div className="d-flex justify-content-between align-items-center mb-3">
      <h4 className="mb-0">Teacher Entry</h4>
      <button className="btn btn-outline-danger btn-sm" onClick={closing}>âœ•</button>
    </div>

    <form onSubmit={submit}>
      <div className="row g-3">

        <div className="col-md-6">
          <label className="form-label">Name</label>
          <input type="text" className="form-control" value={Name} onChange={(e) => setName(e.target.value)} />
        </div>

        <div className="col-md-6">
          <label className="form-label">Surname</label>
          <input type="text" className="form-control" value={Surname} onChange={(e) => setSurname(e.target.value)} />
        </div>

        <div className="col-md-6">
          <label className="form-label">Last Education</label>
          <input type="text" className="form-control" value={Edu} onChange={(e) => setEdu(e.target.value)} />
        </div>

        <div className="col-md-6">
          <label className="form-label">Stream</label>
          <input type="text" className="form-control" value={Stream} onChange={(e) => setStream(e.target.value)} />
        </div>

        <div className="col-md-4">
          <label className="form-label">Commission</label>
          <input type="number" className="form-control" value={Comm} onChange={(e) => setComm(e.target.value)} />
        </div>

        <div className="col-md-8">
          <label className="form-label">Address</label>
          <input type="text" className="form-control" value={Add} onChange={(e) => setAdd(e.target.value)} />
        </div>

        <div className="col-md-6">
          <label className="form-label">Aadhaar Number</label>
          <input type="number" className="form-control" value={Adno} onChange={(e) => setAdno(e.target.value)} />
        </div>

        <div className="col-md-6">
          <label className="form-label">Reference</label>
          <input type="text" className="form-control" value={Ref} onChange={(e) => setRef(e.target.value)} />
        </div>

        <div className="col-md-6">
          <label className="form-label">Mobile Number</label>
          <input type="number" className="form-control" value={Mob} onChange={(e) => setMob(e.target.value)} />
        </div>

        <div className="col-md-6">
          <label className="form-label">Date Of Joining</label>
          <input type="date" className="form-control" />
        </div>

      </div>

      <div className="d-grid mt-4">
        <button type="submit" className="btn btn-primary btn-lg">
          Submit
        </button>
      </div>
    </form>

  </div>
</div>

      <div className="teacher-container" id='tSearch'>
        <h3>Teacher Info</h3>
      </div>
    </>
  )
}

export default Student
